import React from "react";
import Navigation from "./Navigation";

const Header = () => {
  return (
    <div>
     
    <header>
      <nav>
        <ul>
          <li>Home</li>
          <li>About Me</li>
          <li>Star Wars</li>
          <li>Contact</li>
        </ul>
      </nav>
      <h1>Luke SkyWalker</h1>
    </header>
      <Navigation />
    </div>
  );
};

export default Header;
